import './App.css';
import TopBar from './components/topbar/topbar';
import Home from './pages/home/home';
import About from './pages/about/about';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom"

function App() {
  return (
    <Router>
      <TopBar/>
      <Switch>
        <Route path="/home">
         <Home/>
        </Route>
      </Switch>

    </Router>
  );
}

export default App;
